						globalPid: '1015604876',
						langLocale: 'en_US',
						colorDescription: 'White/Blue Jay/Black/University Red',
						slug: 'air-max-95-premium-mens-shoes-Wg4wkZ',
						fullTitle: "Nike Air Max 95 Premium Men's Shoes",
						title: 'Nike Air Max 95 Premium',
						subtitle: "Men's Shoes",
						descriptionHeading: 'Benefits',
						description:
							'<div class="pi-tier3"><div class="pi-pdpmainbody"><p><b>&nbsp;</b></p><br><p>The classic is back. Taking inspiration from the human body and \'90s track aesthetic, the Nike Air Max 95 mixes unbelievable comfort with head-turning design. Wavy side panels add natural flow to any outfit while a mix of leather, airy knits and breathable mesh give these kicks a premium look and feel. Plus, Nike Air in the heel and forefoot delivers comfort with every step.</p><br><p><b>Benefits</b></p><ul><li>Upper draws inspiration from the human body—the midsole represents the spine, graduated panels are the muscles and the laces are the shoe’s ribs.</li><li>Originally designed for performance running, Nike Air cushioning in the heel and forefoot put the history of comfort beneath your feet.</li><li>Flex grooves in the midsole/outsole let you move freely.</li></ul><br><p><b>Product Details</b></p><ul><li>Foam midsole</li><li>Rubber outsole</li><li>Not intended for use as Personal Protective Equipment (PPE)</li></ul><br><p><b>Air Max 95</b></p><p>There are layers to the Air Max 95. Sporting a grooved design, these were the first Nike shoes to don a forefoot Air unit. And debuting with a black sole, unheard of at the time, these kicks looked fresh no matter where you stepped.</p></div></div>',
