							jsonBody: {
								type: 'doc',
								content: [
									{
										type: 'paragraph',
										content: [
											{ text: 'This retro running shoe is ready for its revival.', type: 'text' },
											{
												text: "In 1977, Nike released the LD-1000...then recalled it shortly after due to safety concerns with its dramatically flared heel. Phil Knight expected backlash for the recall, but instead he received gratitude from devout runners and loyal customers. Nike went back to the drawing board, producing hit after hit to satisfy every runner's needs, creating some of the most iconic running shoes in history. The LD-1000 was shelved and took a back seat to stardom for decades—but it wasn't forgotten.",
												type: 'text',
											},
											{
												text: 'Well, the wait is over. The daring flared heel is making its long-awaited comeback. This edition of the heritage classic returns with pace and charisma, dressed in nostalgic Game Royal and Opti Yellow hues. Real and synthetic leather merge with airy textiles and the iconic Waffle sole to create the old-school look you love.',
												type: 'text',
											},
											{ text: 'SKU: FQ9079-400', type: 'text' },
										],
									},
								],
							},
							body: "<p>This retro running shoe is ready for its revival.<br>\nIn 1977, Nike released the LD-1000...then recalled it shortly after due to safety concerns with its dramatically flared heel. Phil Knight expected backlash for the recall, but instead he received gratitude from devout runners and loyal customers. Nike went back to the drawing board, producing hit after hit to satisfy every runner's needs, creating some of the most iconic running shoes in history. The LD-1000 was shelved and took a back seat to stardom for decades—but it wasn't forgotten.<br>\nWell, the wait is over. The daring flared heel is making its long-awaited comeback. This edition of the heritage classic returns with pace and charisma, dressed in nostalgic Game Royal and Opti Yellow hues. Real and synthetic leather merge with airy textiles and the iconic Waffle sole to create the old-school look you love.<br>\nSKU: FQ9079-400</p>",
