						description:
							'<div class="pi-tier3"><div class="pi-pdpmainbody"><p><b>&nbsp;</b></p><br><p>This retro running shoe is ready for its revival. In 1977, Nike released the LD-1000...then recalled it shortly after due to safety concerns with its dramatically flared heel. Phil Knight expected backlash for the recall, but instead he received gratitude from devout runners and loyal customers. The LD-1000 was shelved and took a back seat to stardom for decades—but the wait is over.</p><br><p><b>Benefits</b></p><ul><li>Real and synthetic leather merge with airy textiles for a durable nd breathable fit.</li><li>Iconic Waffle sole creates the old-school look you love.</li></ul><br><p><b>Product Details</b></p><ul><li>Foam midsole</li><li>Rubber outsole</li></ul></div></div>',
